#Identify missing/null records:
SELECT * FROM retail_data WHERE Profit IS NULL OR InventoryDays IS NULL;

#Handle missing values:
DELETE FROM retail_data WHERE Profit IS NULL; 

#Remove duplicates:
DELETE FROM retail_data
WHERE OrderID IN (
  SELECT OrderID FROM (
    SELECT OrderID, COUNT(*) FROM retail_data GROUP BY OrderID HAVING COUNT(*) > 1
  ) dup
);

#Profit Margin by Category & Sub-Category
SELECT 
  Category,
  SubCategory,
  SUM(Sales) AS TotalSales,
  SUM(Profit) AS TotalProfit,
  (SUM(Profit)/SUM(Sales)) * 100 AS ProfitMargin
FROM retail_data
GROUP BY Category, SubCategory
ORDER BY ProfitMargin ASC;

#Seasonal Behavior (Monthly Trends)
SELECT 
  EXTRACT(MONTH FROM OrderDate) AS Month,
  Category,
  SUM(Sales) AS MonthlySales,
  SUM(Profit) AS MonthlyProfit
FROM retail_data
GROUP BY Month, Category
ORDER BY Month;

